# Stream length test
---
operatorFile: mapAccessProp.yaml
testCases:
- name: Simple
  generics:
    keyType:
      type: string
    valueType:
      type: number
  properties:
    key: "b"
  data:
    in:
    - [{key: "a", value: 1}, {key: "b", value: 2}]
    - [{key: "a", value: 3}, {key: "b", value: 6}, {key: "c", value: 1}]
    - [{key: "a", value: 3}, {key: "c", value: 1}]
    out:
    - 2
    - 6
    - null